Да.
Школы:
GoTo: осенняя смена 2016 и весенняя 2017 - биоинформатика;
Летняя Школа Малого Мехмата: 2015;
Математический лагерь 2x2: весна 2016;
Олимпиады:
Всероссийская олимпиада школьников по информатике (8 класс) : 2017 - победитель (округ, дальше не идет);
Всероссийская олимпиада школьников по математике (8 класс): призер;
Мат. праздник (7 класс): 2016 - диплом 3 степени;
Призер Бауманской Олимпиады 2017 - информатика и математика;
Всякие другие олимпиады, регаты по математике.

Опыт участие в олимпиадах по программированию у меня очень мал, это один отборочный этап на Всеросс, я его прошел, но дальше не сложилось.
По математике:
-осенний олимп, диплом 3 степени;
-московская физико-математичексая олимпиада(Физтех) диплом 2 степени;
-муниципальный этап Всеросса, призёр.
